import React, { useState } from 'react';
import OwlCarousel from 'react-owl-carousel';
import image1 from '../../../assets/carousel-item-1.png';
import image2 from '../../../assets/11.png';
import image3 from '../../../assets/12.png';
import image4 from '../../../assets/13.png';
import image5 from '../../../assets/14.png';
import image6 from '../../../assets/15.png';

const ImageCarousel = () => {
  const [activeSlide, setActiveSlide] = useState(0);

  const images = [
    {
      id: 1,
      url: image1
    },
    {
      id: 2,
      url: image2
    },
    {
      id: 3,
      url: image3
    },
    {
      id: 4,
      url: image4
    },
    {
      id: 5,
      url: image5
    },
    {
      id: 6,
      url: image6
    }
  ];

  return (
    <div className="mx-auto grid place-items-center px-6 md:px-12" style={{ maxWidth: '1550px' }}>
      <OwlCarousel className="owl-theme" loop margin={10} nav>
        <div className="item">
          <h4>1</h4>
        </div>
        <div className="item">
          <h4>2</h4>
        </div>
        <div className="item">
          <h4>3</h4>
        </div>
        <div className="item">
          <h4>4</h4>
        </div>
        <div className="item">
          <h4>5</h4>
        </div>
        <div className="item">
          <h4>6</h4>
        </div>
        <div className="item">
          <h4>7</h4>
        </div>
        <div className="item">
          <h4>8</h4>
        </div>
        <div className="item">
          <h4>9</h4>
        </div>
        <div className="item">
          <h4>10</h4>
        </div>
        <div className="item">
          <h4>11</h4>
        </div>
        <div className="item">
          <h4>12</h4>
        </div>
      </OwlCarousel>
      ;
    </div>
  );
};

export default ImageCarousel;
